<p><span class="slidev-note-click-mark" data-clicks="1"></span> Always use object property syntax for your method signatures. It's safer and catches more errors.
<span class="slidev-note-click-mark" data-clicks="2"></span> Avoid method shorthand syntax, even though it might look more concise.
<span class="slidev-note-click-mark" data-clicks="3"></span> You can enforce this using the ESLint rule @typescript-eslint/method-signature-style.</p>
